import React from 'react'
import TodoItem from './TodoItem'

function Todo (props) {
  console.log(props)
  ({ items, onDelete, onCheckBox, onUpdate, onNote, onDueDate } = props);
  const handleDelete = key => onDelete(key)

  const handleCheckBox = key => onCheckBox(key)

  const handleUpdate = (key, event) => onUpdate(key, event)

  const handleNote = (key) => onNote(key)

  const handleDueDate = key => onDueDate(key)

  return (
    <ul>
      <TodoItem
        props={props} onDelete={key => handleDelete(key)}
        onCheckBox={key => handleCheckBox(key)}
        onUpdate={(key, event) => handleUpdate(key, event)}
        onNote={key => handleNote(key)}
        onDueDate={key => handleDueDate(key)}
      />
    </ul>
  )
}

export default Todo
